def chros_mutation(population_list,sequence, mc_op, max_sublot, theta_max, SStM, SSwM, SSD, ROAM, IOAM, OSSM):
    population_size = len(population_list)
    offspring_list = []
    
    # Create child:   
    for m in range(population_size):
        parent = population_list[m]
        
        # LHS Sublot Step Mutation (SStM)           
        if np.random.uniform(0,1)<SStM:
            # Generate random Crossover point
            for i in range(len(parent['LHS'])):
                for j in range(max_sublot[i]):
                    thera = theta_max* np.random.rand()
                    if np.random.uniform(0,1) <0.5:  # Chia doi ty le tang/giam
                        population_list[m]['LHS'][i][j] = min(0.99, math.ceil((population_list[m]['LHS'][i][j] + thera)*100)/100)
                    else:
                        population_list[m]['LHS'][i][j] = max(0, math.ceil((population_list[m]['LHS'][i][j] - thera)*100)/100) 
           
        # LHS Sublot Swap Mutation (SSwM)            
        if np.random.uniform(0,1)<SSwM:
            for i in range(len(parent['LHS'])):
                np.random.permutation(population_list[m]['LHS'][i])
        
        #LHS Sublot Size Degenerator (SSD)
        for i in range(len(parent['LHS'])):
            total_sublot_rate = sum(population_list[m]['LHS'][i])  
            if (total_sublot_rate > 0):        
                for j in range(max_sublot[i]):
                    if ((population_list[m]['LHS'][i][j] / total_sublot_rate)  < SSD):
                        population_list[m]['LHS'][i][j] = 0                   
                
        # RHS Random Operation Assignment Mutation (ROAM)
        if np.random.uniform(0,1)<ROAM:
            ROAM_pick_index = random.sample(range(len(parent['RHS'])), int(len(parent['RHS'])*ROAM))
            ROAM_pick_index.sort()
            for i in ROAM_pick_index:
                # Replace different machine to the gene 
                population_list[m]['RHS'][i][3] = np.random.choice([z for z in range(mc_op[population_list[m]['RHS'][i][2]]) if z != population_list[m]['RHS'][i][3]])
                                        
        # RHS Intelligent Operations Assignment Mutation (IOAM)
        if np.random.uniform(0,1)<IOAM:
            machine_assigne_time =[[0 for i in range(mc_op[k])] for k in range(len(mc_op))]
            for i in range(len(population_list[m]['RHS'])):
                for n in range(len(machine_assigne_time)):
                    for p in range(len(machine_assigne_time[n])):
                        if population_list[m]['RHS'][i][2:] == [n, p]:
                            machine_assigne_time[n][p] +=1
            for n in range(len(machine_assigne_time)):
                max_mc, freq_max = max(list(enumerate(machine_assigne_time[n])), key=lambda x:x[1])
                min_mc, freq_min = min(list(enumerate(machine_assigne_time[n])), key=lambda x:x[1])
                # Change machine from maximum workload to the minimum workload
                total_max_index = []
                total_min_index = []
                for i in range(len(population_list[m]['RHS'])):
                    if population_list[m]['RHS'][i][2:] == [n, max_mc]:
                        total_max_index.append(i)
                    if population_list[m]['RHS'][i][2:] == [n, min_mc]:
                        total_min_index.append(i)
                    if len(total_max_index) > 0:
                        max_index = np.random.choice(total_max_index)
                        population_list[m]['RHS'][max_index][3] = min_mc
                    if len(total_min_index) > 0:      
                        min_index = np.random.choice(total_min_index)
                        population_list[m]['RHS'][min_index][3] = max_mc
                    
                #print(max_mc, min_mc)
            #print(machine_assigne_time)            
        # RHS Operations Sequence Shift Mutation (OSSM)
        if np.random.uniform(0,1)<OSSM:
            OSSM_index = np.random.choice(range(len(population_list[m]['RHS'])))
            OSSM_value = copy.deepcopy(population_list[m]['RHS'][OSSM_index])
            
            # Find previous/ next operation sequence
            previous = sequence[population_list[m]['RHS'][OSSM_index][0]][0]
            next_ = sequence[population_list[m]['RHS'][OSSM_index][0]][-1]
            objects = sequence[population_list[m]['RHS'][OSSM_index][0]]
            l = len(objects)
            for index, obj in enumerate(objects):
                if obj == OSSM_index:
                    if index > 0:
                        previous = objects[index - 1]
                    if index < (l - 1):
                        next_ = objects[index + 1]
            # Find previous/ next chromosome of sublot 
            prev_OSSM_index = [population_list[m]['RHS'][i][0:3] for i in range(len(population_list[m]['RHS']))].index(population_list[m]['RHS'][previous][0:3])
            next_OSSM_index = [population_list[m]['RHS'][i][0:3] for i in range(len(population_list[m]['RHS']))].index(population_list[m]['RHS'][next_][0:3])
            
            new_OSSM_index = np.random.choice([z for z in range(prev_OSSM_index, next_OSSM_index) if z != OSSM_index])
            population_list[m]['RHS'].remove(population_list[m]['RHS'][OSSM_index])
            population_list[m]['RHS'].insert(new_OSSM_index, OSSM_value) 
        #print('p = ',m, parent_1)
        #print('c = ',m, child_1)
        #offspring_list.extend((child_1, child_2))
        
    return population_list
